import React from 'react';
import { XAxis as RechartsXAxis } from 'recharts';

const XAxisWrapper = ({ dataKey, label, ticks }) => {
  const { value, position } = label; // Dobijamo vrednost i poziciju iz label objekta
  return <RechartsXAxis dataKey={dataKey} label={{ value, position }} ticks={ticks} />;
};

export default XAxisWrapper;
